    var hadrst = false;
    $(".toggle-nav").click(function(event) {
        event.stopPropagation();
        if (hadrst == false) {
            $("#nav_navbar").animate({
                "right": "0px"
            });
            $('body').addClass('bodysearch');
            hadrst = true;
        } else {
            $("#nav_navbar").animate({
                "right": "-250px"
            });
            $('body').removeClass('bodysearch');
            hadrst = false;
        }
    });
    
    $(".close-btn").click(function(event) {
        event.stopPropagation();
        hadrst = false;
        $("#nav_navbar").animate({
            "right": "-250px"
        });
        $('body').removeClass('bodysearch');
    });
    

