var compare = function (type, request_str) {
    console.clear();
    var req_data = {
        'string': request_str,
        "type" : type
    };
    console.log(req_data);
    
    $.ajax({
        url : "services/home_data_list",
        type : "POST",
        data: {'string': request_str,
        "type" : type},
        success : function ( res ){
            //console.log( res ); 
            setCookiesData (res);
        }
    }); 
};

/*============ SET COOKIES DATA =====================
*/
var setCookiesData = function (res){
	//var selectedCompanies = getCookie("sortListedCompanies"); // Fetch data form cookie  
	var cookie_array = [];
	var obj = JSON.parse(res)
	var comp_data = obj.record;
	$.each(comp_data, function(key, value){
		console.log(value);
		cookie_array.push(value.id);
	});
	selectedCompanies = cookie_array.join();
	var p = new Date; //Get Current Date And Time
    p.setTime(p.getTime() + 864e5); //Set Time to Expiry
	document.cookie = "sortListedCompanies=; expires=Thu, 01 Jan 1970 00:00:00 UTC; ";  //Expire that cookies
	document.cookie = "sortListedCompanies=" + selectedCompanies + "; expires=" + p + "; ";    
	location.assign("/compare-company")  
}
